import {Card} from "react-bootstrap";
import {useNavigate} from "react-router-dom";

let PopularHotel = ({max, scrollRef}) => {
    let navigate = useNavigate();

    //로그인값 주입 후에 계산 -- 로그인 받아와야함
    let onValidate = () => {
        /*      if(login === null){
                  alert('로그인창으로 이동합니다.')
                  navigate = '/login';
              }*/
    }

    let moveToDetail = () => {
        navigate('/details/');
    }

    return (
        <div style={{marginTop: '40px', cursor: 'pointer'}} onClick={onValidate}>
            {Array.from({length: max}, (_, index) => (
                <a style={{display: 'inline-block'}} onClick={moveToDetail} ref={scrollRef.current[1]}>
                    <Card style={{width: '300px', height: '180px', margin: '10px 5px 10px'}}>
                        <Card.Img variant="top" src="holder.js/100px180" style={{width: '100%', height: '100%'}}/>
                        <Card.Body>
                            <Card.Text>
                                Some quick example text to build on the card title and make up the
                                bulk of the card's content.
                            </Card.Text>
                        </Card.Body>
                    </Card>
                </a>
            ))}
        </div>
    )
}

export default PopularHotel;
